import React from 'react';
import './Rex.css';

function Rex() {
  return (
    <div className="rex-container">
      <img src="" alt="Rex Certification" className="rex-image fade-in" />
      <div className="rex-details fade-in">
        <h2 className="rex-title">Rex Certification</h2>
        <p className="rex-description">
          Our Rex certification affirms our commitment to excellence in product safety and compliance with regulatory standards, ensuring quality in all our packaging solutions.
        </p>
      </div>
    </div>
  );
}

export default Rex;
